import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

import Lab from './Lab';
import './App.css';

function App() {
  const [started, setStarted] = useState(false);

  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home onStart={() => setStarted(true)} />} />
        {/* Always allow the Lab route */}
        <Route path="/lab/:id" element={<Lab />} />
      </Routes>
    </Router>
  );
}

export default App;
